contracts/Congress.sol.content:
pragma solidity ^0.4.16;

contract admined {
    address public admin;

    function admined() {
        admin = msg.sender;
    }

    modifier onlyAdmin() {
        if(msg.sender != admin) throw;
        _;
    }

    function transerAdminship(address newAdmin) {
        admin = newAdmin;
    }

}

contract Congress is admined {

    uint public minimumQuorum;
    uint public debatingPreriodInMinutes;
    int public majorityMargin;
    Proposal[] public proposals;
    uint public numProposals;
    mapping (address => uint) public memberId;
    Member[] public members;

    modifier onlyMembers {
        if(memberId[msg.sender] == 0) throw;
        _;
    }

    struct Member {
        address member;
        string name;
        uint memberSince;
    }

    struct Proposal {
        address recipient;
        uint amount;
        string description;
        uint votingDeadline;
        bool executed;
        bool proposalPassed;
        uint numberOfVotes;
        int currentResult;
        bytes32 proposalHash;
        Vote[] votes;
        mapping (address => bool) voted;
    }

    struct Vote {
        bool inSupport;
        string name;
        uint menberSince;
    }

    /* First time setup */
    function Congress(
        uint minimumQuorumProposal,
        uint minutesForDebate,
        int marginOfVotesForMajority,
        address congressLeader
    ) payable public {
        changeVotingRules(minimumQuorumProposal, minutesForDebate, marginOfVotesForMajority);

        if(congressLeader == 0) admin = msg.sender;
        else admin = congressLeader;

        addMember(0, "");
        addMember(admin, "Admin");
    }

    /*make member*/
    function addMember(address targetMember, string memberName) onlyAdmin public {
        uint id;
        if(memberId[targetMember] == 0) {
            memberId[targetMember] = members.length;
            id = members.length;
            members.length = members.length + 1;
            members[id] = Member({member: targetMember, memberSince: now, name: memberName});
        } else {
            id = memberId[targetMember];
            Member m = members[id];
        }
    }

    function removeMember(address targetMember) onlyAdmin public {
        if(memberId[targetMember] == 0) throw;
        for(uint i = memberId[targetMember]; i < members.length-1; i++) {
            members[i] = members[i + 1];
        }
        delete members[members.length-1];
        members.length--;
    }

    /*change rules*/
    function changeVotingRules(
        uint minimumQuorumProposal,
        uint minutesForDebate,
        int marginOfVotesForMajority
    ) public onlyAdmin {
        minimumQuorum = minimumQuorumProposal;
        debatingPreriodInMinutes = minutesForDebate;
        majorityMargin = marginOfVotesForMajority;
    }

    /* Function to create a new proposal */
    function newProposal(
        address beneficiary,
        uint etherAmount,
        string jobDescription,
        bytes transactionBytecode 
    ) onlyMembers public returns(uint proposalID){
        proposalID = proposals.length;
        proposals.length = proposals.length + 1;
        Proposal p = proposals[proposalID];
        p.recipient = beneficiary;
        p.amount = etherAmount;
        p.description = jobDescription;
        p.proposalHash = sha3(beneficiary, etherAmount, transactionBytecode);
        p.votingDeadline = now + debatingPreriodInMinutes + 1 minutes;
        p.executed = false;
        p.proposalPassed = false;
        p.numberOfVotes = 0;
        numProposals = proposalID+1;
        return proposalID;
    }

    /* function to check if a proposal code matches */
    function checkProposalCode(
        uint proposalNumber, 
        address beneficiary, 
        uint etherAmount, 
        bytes transactionBytecode
        ) public constant returns(bool codeChecksOut) {

    }

    function vote() public {

    }

    function executeProposal(uint proposalNumber, bytes transactionBytecode) public {

    }

    function () payable public {
    }


}

